4781","channelId":"UCDbzZ9YQgF77C1RI_pNx0jQ","isOwnerViewing":false,"shortDescription":"Os algoritmos de Machine Learning e os modelos de segurana esto viabilizando nveis mais elevados de autonomia em Sistemas Ciberfsicos (CPS) modernos. Garantir uma operao autnoma segura requer a estrita observncia das restries de tempo e segurana, melhor expressas em termos dos dados consumidos, em vez das tarefas executadas. Esta palestra apresenta um design Data-Centric para Sistemas Orientados a Dados, utilizando o conceito de SmartData, uma construo de dados enriquecida com metadados para encapsular origem, semntica e relacionamentos. O SmartData interage por meio de relaes de Interesse, herdando requisitos como frescura, periodicidade e segurana. Atravs deste design, uma clara relao com lgicas temporais surge, permitindo a derivao de propriedades do sistema de forma automatizada e permitindo a verificao em tempo de execuo.","isCrawlable":true,"thumbnail":{"thumbnails":[{"url":"https://i.ytimg.com/vi/x1bPzUG9v3Y/hqdefault.jpg?v=68b203b4\u0026sqp=CMSgqMYG-oaymwEiCKgBEF5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\u0026rs=AOn4CLB0DSOZx0HdSjtO86hTH34YnoUuMg","width":168,"height":94},{"url":"https://i.ytimg.com/vi/x1bPzUG9v3Y/hqdefault.jpg?v=68b203b4\u0026sqp=CMSgqMYG-oaymwEiCMQBEG5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\u0026rs=AOn4CLDTGTod-0SQpq-8vBgy-M1UNFsxXg","width":196,"height":110},{"url":"https://i.ytimg.com/vi/x1bPzUG9v3Y/hqdefault.jpg?v=68b203b4\u0026sqp=CMSgqMYG-oaymwEjCPYBEIoBSFryq4qpAxUIARUAAAAAGAElAADIQj0AgKJDeAE=\u0026rs=AOn4CLAcyJKl9jLw7BdAac7rSs0eHkmyzw","width":246,"height":138},{"url":"https://i.ytimg.com/vi/x1bPzUG9v3Y/hqdefault.jpg?v=68b203b4\u0026sqp=CMSgqMYG-oaymwEjCNACELwBSFryq4qpAxUIARUAAAAAGAElAADIQj0AgKJDeAE=\u0026rs=AOn4CLCgj_H4LPN4vFcvE--HwCFOU5HKRA","width":336,"height":188}]},"allowRatings":true,"viewCount":"128","author":"Forum da Ps-Graduao em Computao do Paran","isLowLatencyLiveStream":true,"isPrivate":false,"isUnpluggedCorpus":false,"latencyClass
